import logo from './logo.svg';
import './App.css';

import Login from './login';
import Register from './register';
import Reset from './reset';
import Timeline from './timeline';
import Singal_post from './singal_post';
import Upload from './upload_post';

class App extends React.Component{
  constructor(props){
    super(props);

    this.state={
      num: 1
    }
  }

  fun =()=>{
    (this.state.num === true) ? (this.setState({num: false})) : (this.setState({num: true}))
  } 

  render(){
  return (
    <div>

    <Register />
    <Login />
    <Timeline change = {this.fun} abc={this.state.num}/>

    {/* <Upload /> */}

    {this.state.num === 1 && (<Register />)}

    {this.state.num === 2 && (<Login />)}

    {this.state.num === 3 && (<Timeline />)}

    {this.state.num === 4 && (<Upload/>)}

    {/* {this.state.num === true ? <Upload /> :""} */}

    {/* {
    this.state.num === true?)
    {
        <Upload />
    }} */}


    </div>


  );
  }
}

export default App;
